Gnathosoma (
Fig. 1b, c
) — Hypostome bearing four pairs of simple setae (
Fig. 1c
). Epistome (
Fig.1b
) triangular, reticulated raising striation, denticulated posterior half. Hypostomal groove with six transverse rows of denticles, each having 12 – 18 small teeth and smooth anterior and posterior lines. Corniculi 11 – 15 long, robust and hornlike, reaching the mid-level of palp femur. Internal malae complex-fringed, with two separated pairs of lobes, inner one, narrow, tapered, with fine hairs on outer-side, while outer lobes coarsely fringed with 7 – 9 arms. Labrum elongated, subtriangular, with pilose surfaces and extending to middle level of palp-genu. Chelicera (
Fig.1d
) - Fixed digit of chelicera with five teeth and terminal hook, a pilus dentilis short and setiform, movable digit 18 – 22 long, bidentated, plus terminal hook; arthrodial corona fringe-like.

Palp chaetotaxy (
Fig. 1e
) — trochanter (2)- femur (5)- genu (6)- tibia (14)-tarsus (15); tarsal claw 2- tined (
Fig. 1f
), all setae smooth, simple except setae al1 stout, and al2 on genua and al, ad on femur, thick and spine-like.

